    "2016-07-27T23:02:24.283247",nt"name": "stream-life-of-spawning-pink-salmon-and-the-method-of-escapement-enumeration-by-aerial-sur",nt"isopen":
    false,nt"url": null,nt"notes": "Aerial surveys are currently used as the
    method tor escapement enumeration of pink salmon throughout Alaska. Other escapement
    enumeration methods cannot be realistically applied to pink salmon because of the
    great number of spawning streams utilized by the constituent stocks that are jointly
    exploited in various management units. In the aerial survey methodology the peak
    counts are used as the index of escapement. The purpose of this paper is to consider
    the magnitude of error associated with the loss of dying and dead fish from the
    stream of interest.",nt"license_title": "License Not Specified",nt"extras":
